import React, { FC } from "react";

const Footer: FC = () => {
	return (
		<div className="footer">
			<div className="footer-container">
				<div className="left-footer">Copyright ANCKR 2022</div>
				<div className="right-footer">Own it, share it, monetize it.</div>
			</div>
		</div>
	);
};

export default Footer;
